import { useState } from "react";
import { useEffect } from "react";


const ShowMetrics = prop => {
    const [transactionMetrics, setTransactionMetrics] = useState([]);
    const [register, setRegister] = useState([])
    const [reff] = useState([])
    const [product] = useState([])
    const [influencer] = useState([])

    useEffect(() => {
        const handlerFetchMetrics = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch(`${process.env.API_PATH}/v1/product/transaction/sells/metrics`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }

        // handler registers user
        const handlerFetchRegister = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch(`${process.env.API_PATH}/v1/product/transaction/sells/metrics`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }

        // handler refferer users
        const handlerFetchRef = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch(`${process.env.API_PATH}/v1/product/transaction/sells/metrics`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }

        // handler products/services
        const handlerFetchProduct = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch(`${process.env.API_PATH}/v1/product/transaction/sells/metrics`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }

        // handler influencers
        const handlerFetchInfluencer = async () => {
            // fetch metrics
            const getFetchMetrics = await fetch(`${process.env.API_PATH}/v1/product/transaction/sells/metrics`, {
                headers: {
                    'Content-Type': 'application/json',
                    'Access-Control-Allow-Origin': '*'
                }
            });
            const resFetchMetrics = await getFetchMetrics.json();
            setTransactionMetrics(resFetchMetrics);
        }
        handlerFetchMetrics();
    }, [prop]);
    return(
        <>
        <article className="content-metrics-header-mybusiness col-12 col-sm-12 col-lg-12 col-xl-12">
            <ul>
                <li>
                    Ventas: <span className='text-primary'>{transactionMetrics.success}</span>
                </li>
                <li>
                    Registros: <span className='text-secondary'>4.500</span>
                </li>
                <li>
                    Referidos: <span className='text-secondary'>15.000</span>
                </li>
                <li>
                    Productos y servicios: <span className='text-primary'>545.000</span>
                </li>
                <li>
                    Influencers: <span className='text-secondary'>250</span>
                </li>
            </ul>    
        </article>
        </>
    )
}

export default ShowMetrics;
